import { createRouter, createWebHistory } from 'vue-router';
import FiveDayForecast from '@/component/FiveDayForecast.vue';
import MySavedLocations from '@/views/MySavedLocations.vue';

const routes = [
  { path: '/5day', name: 'FiveDayForecast', component: FiveDayForecast },
  { path: '/saved', name: 'MySavedLocations', component: MySavedLocations },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
